        type=''plain''>During the 60s, the struggle for civil rights was at it''s
        peak. Racism was rampant amongst the police department &amp; so was the urge
        for change. Indoctrinated by the views of Malcom X, socialism &amp; etc, the
        Black Panther Party for Self Defense was formed to combat police harrassment
        &amp; brutality of the black community &amp; provide various services &amp;
        food programs for the community. The FBI wasn''t too happy about the fact
        the they were gaining so much support nationwide so they devised the most
        devious plan &amp; sprung it into action when they couldn''t find any legal
        means to bring them down. This is a film by Mario &amp; the legendary Melvin
        Van Peebles.</media:description><media:keywords>black, panther, party, for,
