        yt:format=''6''/><media:credit role=''uploader'' scheme=''urn:youtube'' yt:display=''caddydave''
        yt:type=''partner''>caddydave</media:credit><media:description type=''plain''>This
        is the first post rebuild drive a Panther Tank. This tank was assembled in
        February of 1944. This tank fell through the ice and into a small river in
        Poland in January of 1945. It spent the next 45 years submerged. This rebuild
        started almost 6 years ago and is nearly complete. (some footage provided
        by Greg Taylor of Taylor Restorations and Pahrahdise Ranch. The Maybach engine
        in this tank is using the original block, crank shaft, connecting rods,connecting
        rod bearings, pistons, valves, camshafts , heads. The crankshaft mains were
        ground to remove the rust pits, new main bearing rollers were created to obtain
        the correct bearing clearance. This engine is using the original 6.8:1 compression
        ratio.. This vehicle is part of the collection of the Military Vehicle Technology
        Foundation. For more information check out www.milvehtechfound.com</media:description><media:keywords>Panther,
